// import Nav from './Nav';
// import Photo from './Photo';



const Nav = () => {

  return(
      <nav className="main-nav">
          <ul>
              <li><a href='3'>Cats</a></li>
              <li><a href='#'>Dogs</a></li>
              <li><a href='#'>Computers</a></li>
          </ul>
      </nav>
  );
}

const Photo = (props) => {

  return (
      <div className="photo-container">
          <h2>Results</h2>
          <ul>
             {props.images.map(image =>
                <li><img src={image.src}></img></li>
              )}
          </ul>
      </div>
  );
}


const App = (props) => {

  return (
    <div >
      <Nav />
      <Photo 
        images={props.images}
        key={props.id}
      />

    </div>



  );
}

export default App;
